import { useState } from "react";
import { Link, Navigate } from "react-router-dom";
import { useUserExistContext } from "../../context/userloggedIn";
import "./style.css"


function NavBar(params) {
    const context = useUserExistContext();
    const [redirect, setRedirect] = useState();
    const [results, setResults] = useState([]);

    async function showSearchResults(e) {
        e.preventDefault();
        const formdata = new FormData(e.currentTarget);
        await fetch(`${params.url}search/?q=${formdata.get('find')}`, {
            method: 'GET',
            headers: {
                'Content-type':'application/json'
            }
        }).then(res => {
            const status = res.status;
            res.json().then(res => {
                console.log(res);
                setResults(res);
                setRedirect(true);

            })
        })
    }
    // if(redirect) return <Navigate to="searchresults" results={results}/>

    return (

        <header>
            <div className="container navbar">
                <div className="logo">
                    <a href="/">LOGO</a>
                </div>
                <form onSubmit={showSearchResults}>
                    <div className="searchbar">
                        <input className="input-search" name="find" type={'text'} placeholder={'search User'} />
                        <button ><i className="fa fa-search search-button"></i></button>
                    </div>
                </form>
                <nav>
                    <ul>
                        {!context.user ?<>
                            <li><Link to="login">Login</Link></li>
                            <li><Link to="register">Register</Link></li>
                        </>
                            : <>
                                <li><Link to="requests">Requests</Link></li>
                                <li><Link to="logout">Logout</Link></li>
                            </>}
                    </ul>
                </nav>
            </div>
        </header>
    )
}


export default NavBar;
